import React from "react";
import notes from "../notes";

function createNote(note) {
  return note.title;
}

function Note(props) {
  return (
    <div className="note">
      notes.map(createNote());
      <h1>{props.title}</h1>
      <p>{props.content}</p>
    </div>
  );
}

export default Note;
